export default function Form() {
  return (
    <form>
      <div>
        <label htmlFor="username">Username:</label>
        <input></input>
      </div>
      <div>
        <label htmlFor="password">Password:</label>
        <input></input>
      </div>
      <button type="submit"/>
    </form>
  );
}
